import React from 'react';
import { useQuery } from '@apollo/react-hooks';
import { QUERY_BRANDS } from '../../graphql/Brands';


const Brands = () => {
    const { data, loading, error } =useQuery(QUERY_BRANDS)
    console.log("Brands: ", data)

    return (
        <div>
              <select>
              <option disabled>Select Brands</option>
                  {
                      data.brands.map(brand => (<option>{brand.name}</option>))
                  }
                <option value="brands" >Lamboghini</option>
                <option value="brands" >Ferrari</option>
                <option value="brands" >Ford Mustang</option>
                <option value="brands" >Aston martin</option>
                <option value="brands" >Bugati</option>
                <option value="brands" >Benley</option>
            </select>
        </div>
    )
}

export default Brands;
